import "./App.css";
import Navbar from "./components/Navbar";
import {BrowserRouter,Routes,Route} from "react-router-dom"


const App = () => {
  return (
    <>
    <BrowserRouter>
    <Navbar/>
    <Routes>
      <Route path="/" />
    </Routes>
    </BrowserRouter>
    </>
  );
};

export default App;
